In this chapter we are going to build the equivalent of the following C program: int main(int argc, char *argv[]) { return argc;
} Command line arguments are passed to a C or assembly language program via two parameters to the main function. The first parameter argc is an integer which will contain the count of arguments passed on the command line. The second parameter argv is an array containing the command-line argument strings. In this example, we continue abusing the exit status value as a way to get output from our programs by returning the count of input arguments argc as the exit code. Here is the assembly language version: .text .globl _main
_main: # Set up the stack pushl %ebp movl %esp, %ebp # Load the value of argc into eax movl 8(%ebp), %eax # Return to calling code popl %ebp retl Save this to a file called cli_input.s , then you can compile it by running: $ gcc -m32 cli_input.s -o cli_input.out Then execute and examine the exit status of the process to see if it worked: $ ./cli_input.out; echo "The number of arguments was: $?" You should see the output: The number of arguments was: 1 Eh!? But we haven't passed any arguments!! It turns out there is always one argument in argv even if we haven't passed anything on the command line and that is the file path of the program itself. We will see what this looks like in a later chapter. Let's run it again and pass our own arguments. $ ./cli_input.out 1 2 3; echo "The number of arguments was: $?"
The number of arguments was: 4 We now have three arguments in addition to the program path so we correctly see the number 4 as our exit status.
